import React from "react";

const Index = (props) => {
  const setTime = () => {
    var time = props.curTime;
    var offSet = new Date(props.timezones.Hours._text);
    var newTime = [time.split(":")];
    console.log(newTime);
  };
  return (
    <div className="card">
      <div className="zone">
        <h1>{props.timezones.Name._text}</h1>
        <h3>GMT{props.timezones.Hours._text}</h3>
      </div>
      <div className="time">
        {/* <p>17:30:47</p> */}
        <p>{props.curTime}</p>
        <button onClick={setTime}>button</button>
      </div>
    </div>
  );
};

export default Index;
